<script>
export default {
    name: 'CreditCard'
}

export const cleanType = (type) => {
    return type ? type.replace(/\s/g, '').toLowerCase() : null;
}
</script>

<script setup>
import { computed } from 'vue';
import { cardTypes } from './constants';

const props = defineProps({
    type: {
        type: String,
        validator: (value) => Object.keys(cardTypes).includes(cleanType(value))
    }
});

const amexImage = 'data:image/png;base64,';

const cardImages = {
    americanexpress: amexImage,
    amex: amexImage,
    dinersclub: 'data:image/png;base64,',
    discover: 'data:image/png;base64,',
    jcb: 'data:image/png;base64,',
    google: 'data:image/png;base64,',
    maestro: 'data:image/png;base64,',
    mastercard: 'data:image/png;base64,',
    paypal: 'data:image/png;base64,',
    visa: 'data:image/png;base64,',
    card_back_cvv_3: 'data:image/png;base64,',
    card_cvv_amex: 'data:image/png;base64,'
};

const cardType = computed(() => {
    return props.type ? cardImages[cleanType(props.type)] : null;
});
</script>


<template>
    <img v-if="cardType" :src="cardType">
</template>
